"aboutUsContent" : "Fere fit is a client software for smart wearable devices such as smart watch and device. Its main functions are as follows: 
 1. real time recording of movement steps, mileage, calorie consumption and movement track;
 2. Real time monitoring of sleep, heart rate, blood oxygen, blood pressure, ECG and other health data;
 3. Call, SMS, wechat, QQ, Facebook, twitter and other reminders and content push;
 4. Clock, alarm clock, loss prevention, sedentary reminder, remote photo taking and other functions;
 5. More than ten common exercise training modes, providing real-time exercise time, physical consumption, heart rate monitoring and other data;
 6. Sports and health testing information can be shared at any time, such as wechat circle of friends, forum microblog, Facebook, twitter, etc;
 warm tips: to install this software, the mobile phone system must be Android 4.4, IOS 8.0 or above, and the mobile phone supports Bluetooth ble 4.0."

