attribute vec4 aPosition;
attribute vec4 aTextureCoord;
varying vec2 %s;
void main() {
    gl_Position = aPosition;
    %s = (uTexMatrix * aTextureCoord).xy;
}

precision highp float;
attribute vec3 aVertex;//顶点数组,三维坐标
uniform mat4 aMVPMatrix;//mvp矩阵
void main(){
  gl_Position = aMVPMatrix * vec4(aVertex, 1.0);
}

playstore_details.description:
FereFit is a wearable devices application client software for smart watches and smart bracelet. The main functions include as following:
1.Record steps, mileage, calorie consumption, sports track record;

2.Analysis of daily sleep data, monitoring the quality of sleep;

3.Support Messages, WeChat, QQ ,Facebook,Twitter content pushing and reminder;

4.Clock, alarm clock, anti-lost, sedentary reminder, remote camera and the other function;

5.Support sports and health information sharing on the micro-blog, Twitter, Facebook.

6.Support real-time measure heart rate, blood oxy and blood pressure (for smart bracelet and watches with blood pressure and heart rate function.This test result can only be used as a reference and not as a medical certificate);

7.Our app is an essential companion for your smartwatch, designed to provide seamless connectivity and communication. With our app, you can send and receive SMS messages directly from your smartwatch and make phone calls with ease. These features are integral to the app's core functionality, enabling convenient communication without needing to take out your phone.

Key Features:
- **Send and Receive SMS**: Stay connected by sending and receiving SMS messages directly from your smartwatch.
- **Make Phone Calls**: Effortlessly make phone calls using your smartwatch, keeping your phone in your pocket.
- **Real-time Notifications**: Get instant notifications on your smartwatch, ensuring you never miss an important message or call.

Our app ensures that your data is securely managed, and these permissions are strictly used to enhance your smartwatch experience. Your privacy is our top priority.

Models of related equipment: Zhongke Lanxun, Jerry k11 series

Warm Tips: Install this software must be above 7 Android system, The phone must supports Bluetooth 4.0+.
